import React from 'react';
import './App.css';
import Counter from './Counter';
import Greeter from './Greeter';
import NavBar from './Navbar';

function App() {
  return (
    <div>
      <Counter />
      <NavBar/>
      <Greeter name="Drew" age="62" excitement={4}/>
      <h1>Drew's first app</h1>
    </div>

  );
}

export default App;
